class TestCardanoGraphql(TestCase):

    def test_parse_staking_info(self):
        api = CardanoAPI.get_api()
        api.request = Mock()
        data = {'activeStake': [
            {'epochNo': 382, 'address': 'stake1uymdt2z2898l2263r82st67mh5g2cejjz3hps3cxm3d6w6sr740h9',
             'amount': '1009223169'}], 'withdrawals': [
            {'address': 'stake1uymdt2z2898l2263r82st67mh5g2cejjz3hps3cxm3d6w6sr740h9', 'amount': '8360326'}],
            'rewards_aggregate': {'aggregate': {'sum': {'amount': '12568130'}}}}

        parsed_data = api.parse_staking_info(data)

        assert parsed_data.staked_balance == Decimal('1009.223169')
        assert parsed_data.claimed_rewards == Decimal('8.360326')
        assert parsed_data.rewards_balance == Decimal('12.568130')

    @pytest.mark.slow
    def test_get_staking_info_api_request(self):
        address = 'stake1uymdt2z2898l2263r82st67mh5g2cejjz3hps3cxm3d6w6sr740h9'
        api = CardanoAPI.get_api()

        start_reward_period = datetime.today() - timedelta(days=10)
        end_reward_period = datetime.today()
        data = {
            'query': '''query get_staking_info($address: StakeAddress!, $start_date: DateTime!, $end_date: DateTime!){activeStake(where:{address :{_eq:$address}} limit:1 order_by:{ epochNo:desc}){                epochNo                address                amount              }              withdrawals(where:{address :{_eq:$address}}){                address                amount              }              rewards_aggregate(                where: {                  _and: [                    { address: {_eq:$address} }                    {                      receivedIn: {                        _and: [                          { startedAt: { _gte: $start_date } }                          { startedAt: { _lt: $end_date } }                        ]                      }                    }                  ]                }              ){                aggregate{                  sum{                    amount                  }                }              }            }''',
            'variables': {'address': address, 'start_date': start_reward_period.strftime('%Y-%m-%dT%H:%M:%SZ'),
                          'end_date': end_reward_period.strftime('%Y-%m-%dT%H:%M:%SZ'), }}
        response = api.request('', headers={'Content-Type': 'application/json'}, body=json.dumps(data))
        assert 'data' in list(response.keys())

